class Solution {
    public int accountBalanceAfterPurchase(int purchaseAmount) {
        // Find the remainder when dividing by 10
        int remainder = purchaseAmount % 10;

        // Calculate the rounded amount
        int roundedAmount;
        if (remainder == 0) {
            // If purchaseAmount is already a multiple of 10
            roundedAmount = purchaseAmount;
        } else if (remainder <= 5) {
            // Round down to the nearest multiple of 10
            roundedAmount = purchaseAmount - remainder;
        } else {
            // Round up to the nearest multiple of 10
            roundedAmount = purchaseAmount + (10 - remainder);
        }

        // Subtract the rounded amount from the initial balance and return
        return 100 - roundedAmount;
    }
}
